    String IDyear="2020-2020",Syear="01/01/2020",Eyear="01/01/2020";
    public NewDxITMxStatusOnD2D(String base,String golo,String idy, String sy,String ey) {
        baseadd=base;
        logo=golo;
        IDyear = idy;
        Syear = sy;
        Eyear = ey;
        try {
            user = GetLine.mainn(baseadd+"/Cuser.txt", 2);
        } catch (IOException ex) {
            JLabel label = new JLabel("Current user !!! Error0003"+ex);
            label.setFont(new Font("Arial", Font.BOLD, 18));
            JOptionPane.showMessageDialog(null,label,"ERROR",JOptionPane.WARNING_MESSAGE);
        
        }
        
        initComponents();
        this.setLocationRelativeTo(null);
        try {
            this.setIconImage(ImageIO.read(new File(logo)));
        } catch (IOException ex) {
            JLabel label = new JLabel("Logo Problem !!! Error0001");
            label.setFont(new Font("Arial", Font.BOLD, 18));
            JOptionPane.showMessageDialog(null,label,"ERROR",JOptionPane.WARNING_MESSAGE);
       
        }  
         try {
        lang = GetLine.mainn(baseadd+"/"+user+"/conf.txt", 1);
        
        } catch (IOException ex) {
        JLabel label = new JLabel("Configuration Error !!! Error0003");
        label.setFont(new Font("Arial", Font.BOLD, 18));
        JOptionPane.showMessageDialog(this,label,"ERROR",JOptionPane.WARNING_MESSAGE);
        }
         JTextFieldDateEditor editor = (JTextFieldDateEditor) date1.getDateEditor();
        editor.setEditable(false);
         editor = (JTextFieldDateEditor) date2.getDateEditor();
        editor.setEditable(false);
         try {
            //Calender
            date1.setMinSelectableDate(new SimpleDateFormat("dd/MM/yyyy").parse(Syear));
            date1.setMaxSelectableDate(new SimpleDateFormat("dd/MM/yyyy").parse(Eyear));
            date2.setMinSelectableDate(new SimpleDateFormat("dd/MM/yyyy").parse(Syear));
            date2.setMaxSelectableDate(new SimpleDateFormat("dd/MM/yyyy").parse(Eyear));
        } catch (ParseException ex) {
            JLabel label = new JLabel("There is issue while setup calender bounds");
        label.setFont(new Font("Arial", Font.BOLD, 18));
        JOptionPane.showMessageDialog(this,label,"ERROR",JOptionPane.WARNING_MESSAGE);
        System.exit(1);
        }
         if(lang.compareToIgnoreCase("English")!=0){
        //System.out.println("दिनांक का चयन");
        lbl1.setText("दिनांक का चयन");
        lblf.setText("दिनांक से :");
        lblt.setText("तक :");
        cancel.setText("रद्द करे");
        confirm.setText("कन्फर्म");
        
        }
        try {
        Robot r=new Robot();
        r.keyPress(KeyEvent.VK_ALT);
        r.keyPress(KeyEvent.VK_SHIFT);
        r.keyPress(KeyEvent.VK_0);
        r.keyRelease(KeyEvent.VK_0);
        r.keyRelease(KeyEvent.VK_SHIFT);
        r.keyRelease(KeyEvent.VK_ALT);
    } catch (AWTException ex) {
        JLabel label = new JLabel("Language Setup Error !!");        
        label.setFont(new Font("Arial", Font.BOLD, 18));        
        JOptionPane.showMessageDialog(null,label,"ERROR",JOptionPane.WARNING_MESSAGE);
    }
        
        
        Date datee = new Date();
date1.setDate(datee);
date2.setDate(datee);
confirm.requestFocus();
    }

