    private void date1KeyPressed(java.awt.event.KeyEvent evt) {//GEN-FIRST:event_date1KeyPressed
            int a = evt.getKeyCode();
            if(a==10)
                confirm.requestFocus();
    }//GEN-LAST:event_date1KeyPressed

    private void confirmActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_confirmActionPerformed
        SimpleDateFormat dateFormat = new SimpleDateFormat("dd/MM/yyyy");
String sd1 = dateFormat.format(date1.getDate());
String sd2 = dateFormat.format(date2.getDate());
new ITMxStatusOnD2D(baseadd,logo,sd1,sd2,IDyear,Syear,Eyear).setVisible(true);
this.dispose();

    }//GEN-LAST:event_confirmActionPerformed

    private void confirmKeyPressed(java.awt.event.KeyEvent evt) {//GEN-FIRST:event_confirmKeyPressed
        if(evt.getKeyCode()==KeyEvent.VK_ENTER)
            confirm.doClick();
    }//GEN-LAST:event_confirmKeyPressed

